import React, { useContext, useEffect, useReducer } from 'react'
import UrlsContextProvider, { UrlsContext } from '../contexts/UrlsContext'
import { urlsReducer } from '../reducers/UrlsReducer'

const IndexPage = () => {
  // const { urls } = useContext(UrlsContext)
  const [urls, dispatch] = useReducer(urlsReducer, [
    { url: 'Kappa' },
    { url: 'Kippa' }
  ])

  useEffect(() => {
    console.log(urls)
  }, [])

  return (
    <UrlsContextProvider>
      <div>
        <h1>Index Page</h1>
        {urls.length === 0 ? (
          <p>No Urls Here</p>
        ) : (
          urls.map((url, index) => <p key={index}>{url.url}</p>)
        )}
      </div>
    </UrlsContextProvider>
  )
}

export default IndexPage
